    "2016-07-27T22:40:49.719798",nt"name": "pea-island-national-wildlife-refuge-narrative-report-for-the-period-may-1-through-augu-31-",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Pea Island NWR
    outlines Refuge accomplishments from May through August of 1959. The report begins
    by summarizing the weather conditions, water conditions, and food and cover during
    this period. Wildlife- including migratory birds, upland game birds, and furbearers-
    is also covered. The Refuge development and maintenance section discusses physical
    developments, plantings, vegetation control, and wildfires. Resource management
    is outlined; topics include commercial fishing. A progress report on field investigations
    and applied research is also provided. The public relations section of the report
    describes recreational uses, Refuge visitors, and Refuge participation. N-R forms
    and photographs are attached.",nt"license_title": "License Not Specified",nt"extras":
